import AuthPage from "./pages/AuthPage/AuthPage"
import ItemPage from "./pages/ItemPage/ItemPage"
import Shop from "./pages/Shop/Shop"
import Basket from "./pages/basket/Basket"
import { BASKET_ROUTE, ITEM_ROUTE, LOGIN_ROUTE, REGISTARTION_ROUTE, SHOP_ROUTE } from "./utils/consts"

export const authRoutes = [
    {
        path: BASKET_ROUTE,
        Component: <Basket/>
    }
]

export const publicRoutes = [
    {
        path: SHOP_ROUTE,
        Component: <Shop/>
    }, 
    {
        path: LOGIN_ROUTE,
        Component: AuthPage
    }, 
    {
        path: REGISTARTION_ROUTE,
        Component: <AuthPage/>
    }, 
    {
        path: ITEM_ROUTE + '/:id' ,
        Component: <ItemPage/>
    }, 
    
]
